import React from 'react';

import { Profile } from './Profile/Profile';
import user from '../user';




export const App = () => {
  return (
    <div
      style={{
        height: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        fontSize: 40,
        color: '#010101'
      }}
    >
      <Profile {...user} />
    </div>
  );
};
